import { Box } from "@mui/material";
import { Typography } from "antd";
import React from "react";

function Checkout() {
  return (
    <Box>
      <Typography
        variant="h6"
        sx={{
          fontWeight: "bold",
        }}
      >
        Billing details
      </Typography>
    </Box>
  );
}

export default Checkout;
